import React from "react";
import { Link, Outlet } from 'react-router-dom';




const About = () =>{

  
   
    return(
         
    
      <>
    
        
      <div className="aboutpage">
      
      <h1>Welcome!</h1>
      <p> Click on Below options to get Complete Details of Selected option </p>
    
      <div className="nav_menu">
     
    
              <Link  to= '/mainabout/about/qualification'>Graduation</Link>
        <Link  to= '/mainabout/about/habbits'> Habbits</Link>
        <Link  to= '/mainabout/about/personal'>personalinfo</Link>

       
        </div> 
        <Outlet />
        </div> 
        </>  
       
       
          
        
      
        

 
        
     
        
     
      
               
        
    )
}
export default About ;
